import Tech from '../image/Tech.jpeg'
import Style from '../image/Style.jpeg'
import Music from '../image/Music.jpeg'
import Life from '../image/Life.jpeg'
import Hobbies from '../image/Hobbies.jpeg'
import Food from '../image/Food.jpeg'
import PostList from './postlist'
const PostInfo = () => {
  const info = [
    {
      id: 'post1',
      image: Life,
      categories: 'Life',
      postDate: '1 hour ago',
    },
    {
      id: 'post2',
      image: Music,
      categories: 'Music',
      postDate: '2 hours ago',
    },
    {
      id: 'post3',
      image: Style,
      categories: 'Style',
      postDate: '2 hours ago',
    },
  ]

  const moreInfo = [
    {
      id: 'post4',
      image2: Hobbies,
      categories2: 'Hobbies',
      postDate2: '4 hours ago',
    },
    {
      id: 'post5',
      image2: Tech,
      categories2: 'Tech',
      postDate2: '5 hours ago',
    },
    {
      id: 'post6',
      image2: Food,
      categories2: 'Food',
      postDate2: '5 hours ago',
    },
  ]

  return (
    <>
      <PostList info={info} moreInfo={moreInfo}></PostList>
    </>
  )
}
export default PostInfo
